export const TOMORROW_DATE = (() => {
  const tomorrow = new Date();
  tomorrow.setDate(tomorrow.getDate() + 1);
  const m = tomorrow.getMonth() + 1;
  const d = tomorrow.getDate();
  return `${m < 10 ? '0' + m : m}/${d < 10 ? '0' + d : d}`;
})();
